DESCRIPTION
The ethereal Magdalene St. Michaels returns in volume 2 of Sweet Sinner's hottest new series. Lily Labeau brings home new fiancee Ryan Driller to meet her mother Magdalene and lesbian \&quot;Stepmom\&quot; Aurora Snow. But Magdalene and Ryan share an immediate connection, and they soon begin to haunt each other\'s dreams. Is their attraction based on forbidden desires, or is there a supernatural explanation for their mutual obsession? Timeless love takes on new meaning in this romantic and tragic tale of older/younger love. Written and directed by Nica Noelle.
